The Pythagorean Theorem states that in a right triangle, the square of the length of the hypotenuse (the side opposite the right angle) is equal to the sum of the squares of the lengths of the other two sides. The `math.pythagoras` function calculates the hypotenuse given the lengths of the other two sides.

